import React from 'react';

import slogan1 from './../Assets/img/slogan1.png'; 
import slogan2 from './../Assets/img/slogan2.png';

import blood1 from './../Assets/img/blood1.png';
import blood2 from './../Assets/img/blood2.png'; 
import blood3 from './../Assets/img/blood3.png';
import blood4 from './../Assets/img/blood4.png';

import './HomePage.css';

const HomePage = () => {

  const temp2 = [
    { title: 'Registration', img: blood1 },
    { title: 'Seeing', img: blood2 },  
    { title: 'Donation', img: blood3 },
    { title: 'Save Life', img: blood4 },
  ];

  return (
    <div className="home-page">
      <div className="slogan">
        <img src={slogan1} alt="slogan1" />
        <img src={slogan2} alt="slogan2" />  
      </div>
      
      <div className="steps">
        {temp2.map(step => (
          <div className="step">
            <img src={step.img} alt={step.title} />
            <h3>{step.title}</h3>
          </div>
        ))}
      </div>
    </div>
  );
}

export default HomePage;
